import React, {useState, useEffect} from 'react'
import axios from 'axios'

function Data() {
    const [items, setItems] = useState([])

    useEffect(() => {
        axios
            .get('https://jsonplaceholder.typicode.com/users')
            .then(res => {
                console.log(res),
                setItems(res.data)
            })
            .catch(err => {
                console.log(err)
            })
    })

    return (
        <div>
            <ul>
                {items.map(item => (
                    <li key={items.id}>{items.name}</li>
                ))}
            </ul>
        </div>
    )
}

export default Data;
